import React, { Component } from "react";
import MediaPlayer from "../player/player";
import VideoViewNavbar from "../videoViewNavbar/videoViewNavbar";
import "./videoItem.css";
import "../data";

class VideoItem extends Component {
  state = {};
  render() {
    return (
      <div className="viewer-dim viewer-border viewer-color">
        <VideoViewNavbar className="navbar-border" />
        <MediaPlayer />
      </div>
    );
  }

  mapVideoList() {}
}

export default VideoItem;
